import React from "react";

const Home = () => {
  return (
    <>
      <p>Kezdőlap</p>
      <h1>Kedves Nyelvtanuló!</h1>
      <p>Üdvözöllek weboldalamon. Itt a helyed,</p>
      <ul>
        <li>ha szeretnéd magabiztosan, bátran használni szóban és írásban is a német nyelvet,</li>
        <li>ha német nyelvterületre költözöl és segítségre van szükséged, hogy ki tudd fejezni magad és megértsd ha hozzád szólnak,</li>
        <li>ha sikeres érettségi-, nyelvvizsgát szeretnél tenni,</li>
        <li>ha azt sem tudod, hogy melyik nyelvvizsgát válaszd,</li>
        <li>ha hobbiszinten szeretnéd elsajátítani a német nyelvet.</li>
      </ul>
      <p>Segítek neked leküzdeni félelmeidet, hogy merj megszólalni németül, és magabiztosan, gördülékenyen használd a nyelvet!</p>
    </>
  );
};

export default Home;
